import { CarrosService } from '../carros.service';
import { Component, OnInit } from '@angular/core';
import { Carros } from '../carros';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-update-carros',
  templateUrl: './update-carros.component.html',
  styleUrls: ['./update-carros.component.css']
})



export class UpdateCarrosComponent implements OnInit {

 id!: number;
 carros: Carros = new Carros ();

  constructor(private carrosService: CarrosService,
    private router: Router,
    private route: ActivatedRoute) {}



  ngOnInit(): void {

    this.id = this.route.snapshot.params['id'];
    this.carrosService.getCarrosByid(this.id).subscribe({
      next: (data: Carros) => {
        console.log(data)
        this.carros = data
      },
      error: (error: any) => console.log(error),
      complete: () => console.log("Data init comepleted!")
    })

}

onSubmit() {
  this.updateCarros();
}
updateCarros() {
  this.carrosService.updateCarros(this.id, this.carros)
  .subscribe({
    next: (data: any) => console.log(data),
    error: (error: any) => console.log(error),
    complete: () => this.goToCarroList()
  })
}
goToCarroList() {
  this.router.navigate(['/carros-list'])}
}
<app-root></app-root>
<div class="col-md-6 offset-md-3">
    <h3 class="cor"> Atualizar Carros</h3>
    <form (ngSubmit) = "onSubmit()">

        <div class="form-group">
            <label class="cor"> Marca: </label>
            <input type="text" class ="form-control" id = "marca"
                [(ngModel)] = "carros.marca" name = "marca">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Modelo: </label>
            <input type="text" class ="form-control" id = "modelo"
                [(ngModel)] = "carros.modelo" name = "modelo">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor">  Ano de Fabricação: </label>
            <input type="text" class ="form-control" id = "anoFabricacao"
                [(ngModel)] = "carros.anoFabricacao" name = "anoFabricacao">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Ano de Modelo: </label>
            <input type="text" class ="form-control" id = "anoModelo"
                [(ngModel)] = "carros.anoModelo" name = "anoModelo">
        </div>
        <div class="form-group">
            <label class="cor"> Valor: </label>
            <input type="text" class ="form-control" id = "valor"
                [(ngModel)] = "carros.valor" name = "valor">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Descrição: </label>
            <input type="text" class ="form-control" id = "descricao"
                [(ngModel)] = "carros.descricao" name = "descricao">
        </div>
        <div> </div>
        <button class = "btn btn-success" (click)="updateCarros()">Atualizar Endereço</button>



    </form>
    </div>
